import React from "react";
import classes from "./content.module.css";
const content = (props) => {
  const val = props.val;
  console.log(props.val);
  return (
    <div className={classes.content}>
      <div className={classes.cells}>{val[0]}</div>
      <div className={classes.cells}>{val[1]}</div>
      <div className={classes.cells}>{val[2]}</div>
      <div className={classes.cells}>{val[3]}</div>
    </div>
  );
};

export default content;
